import React from "react";
import Color, { Palette } from "color-thief-react";

const Loading = () => <div>Loading...</div>;
export default function TheColor() {
    const imgSrc = "https://i.picsum.photos/id/866/536/354.jpg";
    return (
        <div className="App">
            <img src={imgSrc} alt="" />
            <Color src={imgSrc} crossOrigin="Anonymous">
                {({ data, loading }) => {
                    if (loading) return <TheColor />;
                    return (
                        <div style={{ color: data }}>
                            Text with predominant color: <strong>{data}</strong>
                        </div>
                    );
                }}
            </Color>

            <Palette src={imgSrc} crossOrigin="Anonymous" colorCount={5} format="hex">
                {({ data, loading }) => {
                    if (loading) return <TheColor />;
                    return (
                        <ul style={{ color: data }}>
                            {data.map(color => (
                                <li key={color} style={{ backgroundColor: color }}>
                                    {color}
                                </li>
                            ))}
                        </ul>
                    );
                }}
            </Palette>
        </div>
    );
}
